import { Header } from '../components/header'
import { ExHeader } from '../components/ExHeader'
import { Product } from '../components/ExHeader'
import { Recommended } from '../components/ExHeader'
import { Banner } from '../components/ExHeader'


export const Home = () => {
    return (
        <>
<Header /> 
<ExHeader />
<Banner />
<Recommended/>
<Product />
</>
    )};


export default Home;
